import React from 'react';
import { Stack,Paper,Divider,Container } from '@mui/material';

export default function Home() {
  return (
  <Stack spacing={0}>
    <Container max>
      Hello World
    </Container>
    <Divider light/>
    <Paper elevation={0}>Hello World</Paper>
    <Divider light/>
  </Stack>
  );
}
